/**
 * Split a string.
 * @param source String to split
 * @param delimiter Character used to split the string.
 * @return Array of split string.
 */
static std::vector<std::string> split(std::string source, char delimiter) {
    std::istringstream test(source);
    std::string segment;
    std::vector<std::string> seglist;
    while(std::getline(test, segment, delimiter))
    {
        seglist.push_back(segment);
    }
    return seglist;
}

const char *get_emoji_url(const char *placeholder) {
    try {
        auto *emoji = &emoji_lookuptable.at(placeholder);
        return emoji->url;
    }
    catch(std::out_of_range& e) {
        return nullptr;
    }
}

const char *get_emoji_glyphs(const char *placeholder) {
    std::string s_placeholder = placeholder;
    try {
        auto *emoji = &emoji_lookuptable.at(placeholder);
        return emoji->emoji;
    }
    catch(std::out_of_range& e) {
        return nullptr;
    }
}

/**
 * The the glyphs to render an emoji placeholder.
 * This code parse the emoji image url and create the multibyte string.
 * @param placeholder  Emoji placeholder.
 * @return The emoji string or NULL if the placeholder is invalid. **User must release the memory.**
 */
static wchar_t *get_w_emoji(const char *placeholder) {
    std::string image;
    try {
        s_emoji *emoji = &emoji_lookuptable.at(placeholder);
        image = emoji->url;
    }
    catch(std::out_of_range& e) {
        return nullptr;
    }
    
    std::string base_filename = image.substr(image.find_last_of("/") + 1);
    std::string::size_type const p(base_filename.find_last_of('.'));
    std::string sequence = base_filename.substr(0, p);
    
    // Split the sequence into single glyphs.
    std::vector<std::string> seglist = split(sequence, '-');
    
    // Buffer for the parsed glyphs.
    auto *rune = (wchar_t *)calloc(seglist.size()+1, sizeof(wchar_t));
    
    int j = 0;
    // std::cout << sizeof(wchar_t) << ' ' << sizeof(long) << "\n";
    for (std::vector<std::string>::const_iterator i = seglist.begin(); i != seglist.end(); ++i) {
        std::string character = *i;
        try {
            std::size_t pos = 0;
            wchar_t glyph = std::stoi(character, &pos, 16);
            if (pos < character.length()) {
                std::cerr << character << " is not an hex number!\n";
                os_log_error(getLogForEmojiExt(), "%{public}s is not an hex number!", character.c_str());
                free(rune);
                return nullptr;
            }
            rune[j] = glyph;
            // FIXME: the github emoji url do not have the some required code to merge multiple glyphs to parse the entire sequence. The Zero Width Joiner U-200D and the Variation Selector U-FE0E and U-FE0F.
            j++;
        } catch (std::invalid_argument) {
            std::cerr << "Unable to parse stoi for character \"" << character << "\".\n";
            os_log_error(getLogForEmojiExt(), "Unable to parse stoi for character \"%{public}s\"!", character.c_str());
            free(rune);
            return nullptr;
        }
    }
    rune[j] = 0; // Null terminate.
    
    return rune;
}


char *get_emoji(const char *placeholder) {
    wchar_t *rune = get_w_emoji(placeholder);
    if (!rune) {
        return nullptr;
    }
    
    std::string current_locale = std::setlocale(LC_ALL, nullptr);
    if (std::setlocale(LC_ALL, "en_US.UTF-8") == nullptr) {
        std::cerr << "setlocale failed.\n";
        os_log_error(getLogForEmojiExt(), "`setlocale` failed!");
    }
    
    // Count required buffer size (plus one for null-terminator).
    size_t size = (std::wcslen(rune) + 1) * sizeof(wchar_t);
    char *buffer = (char *)calloc(1, size);

    size_t convertedSize;
    #ifdef __STDC_LIB_EXT1__
        // wcstombs_s is only guaranteed to be available if __STDC_LIB_EXT1__ is defined

        std::wcstombs_s(&convertedSize, buffer, size, rune, size);
    #else
        convertedSize = std::wcstombs(buffer, rune, size);
    #endif
        
    // Restore previous locale.
    std::setlocale(LC_ALL, current_locale.c_str());
    
    free(rune);
    
    return buffer;
}
